function Footer() {
    return ( 
        <footer className="footer">
            <div className="footerContent">
                <h2>Olivia Wissig</h2>
                <a href="https://www.linkedin.com/in/oliviawissig/">LinkedIn</a>
            </div>
        </footer>
     );
}

